import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
    navContainer: {
        width: '100%'
    },
    navItem: {
        width: 150,
        position: 'relative',
        '& a': {
            textDecoration: 'none'
        }
    },
    navBorder: {
        position: 'absolute',
        bottom: 0,
        width: '100%',
        height: 20
    }
})

export default useStyles
